import { Button, TextField } from "@mui/material";
import { Field, Form, Formik } from "formik";
import { useDispatch } from "react-redux";
import { useNavigate } from "react-router-dom";

export default function WorkspaceCreateForm() {
    const dispatch = useDispatch();
    const navigate = useNavigate();

    const initialValues = {
        name: "",
        description: "",
    };

    const createWorkspace = (workspaceData) => {
        // Perform API call or database operation to create workspace
        return new Promise((resolve, reject) => {
            // Simulating async operation with setTimeout
            setTimeout(() => {
                // Resolve if workspace creation is successful
                // Reject with error message if workspace creation fails
                const success = true; // Set to false to simulate failure
                if (success) {
                    resolve();
                } else {
                    reject("Failed to create workspace");
                }
            }, 1000); // Delay for demonstration purposes
        });
    };

    const handleSubmit = (values) => {
        createWorkspace(values)
            .then(() => {
                navigate("/workspaces");
            })
            .catch((error) => {
                console.error("Error creating workspace:", error);
            });
    };

    return (
        <Formik initialValues={initialValues} onSubmit={handleSubmit}>
            <Form>
                <div>
                    <h3>Workspace Name:</h3>
                </div>
                <div>
                    <Field as={TextField} name="name" label="Name" variant="outlined" />
                </div>
                <div>
                    <h3>Description of Workspace:</h3>
                </div>
                <div>
                    <Field
                        as={TextField}
                        name="description"
                        label="Description"
                        variant="outlined"
                    />
                </div>
                <br />
                <div>
                    <Button type="submit" variant="contained" color="primary">
                        Create Workspace
                    </Button>
                </div>
            </Form>
        </Formik>
    );
}
